        width: fit-content;
        padding: 0px 10px;

        color: #006ABB;

        background: rgba(255, 255, 255, 0.9);
        border-radius: 10px;
      }
      .cardboard-map-marker-caption-container {
        width: 100%;
        display: flex;
        justify-content: center;
      }
      .cardboard-map-editor .cardboard-map-marker:hover {
        stroke: red;
      }
    </style>
    <use class="cardboard-map-marker"  href="#cardboard-map-marker" data-netid="<?= $marker->id ?>" x="<?= $marker->pos_x ?>" y="<?= $marker->pos_y ?>"/>
