function cardboard_worldmap_activation_hook() {
  global $wpdb;
  $plugin_name_db_version = '1.0';
  $table_name = $wpdb->prefix . "cardboard_worldmap_points"; 
  $charset_collate = $wpdb->get_charset_collate();

  $sql = "CREATE TABLE IF NOT EXISTS $table_name (
        id mediumint NOT NULL AUTO_INCREMENT,
        name tinytext NULL,
        pos_x int NOT NULL,
        pos_y int NOT NULL,
        UNIQUE KEY id (id)
      ) $charset_collate;";

  require_once( ABSPATH . 'wp-admin/includes/upgrade.php' );
  dbDelta( $sql );
  add_option( 'plugin_name_db_version', $plugin_name_db_version );
}
register_activation_hook(__FILE__,'cardboard_worldmap_activation_hook');
add_action('admin_menu', 'cardboard_worldmap_admin_menu');
add_action('init', 'cardboard_worldmap_init');


function cardboard_worldmap_create_point() {
	global $wpdb;

  $table_name = $wpdb->prefix . "cardboard_worldmap_points"; 
	$pos_x = intval( $_POST['pos_x'] );
  $pos_y = intval( $_POST['pos_y'] );
  $name = $_POST['point_name'];
  
  $wpdb->insert(
    $table_name, 
    [
      'pos_x' => $pos_x,
      'pos_y' => $pos_y,
      'name'  => $name
    ],
    [ '%d', '%d', '%s']
  );

	wp_die(); // this is required to terminate immediately and return a proper response
}
add_action( 'wp_ajax_cardboard_worldmap_create_point', 'cardboard_worldmap_create_point' );

function cardboard_worldmap_delete_point() {
	global $wpdb;

  $table_name = $wpdb->prefix . "cardboard_worldmap_points"; 
	$id = intval( $_POST['id'] );
  
  $wpdb->delete(
    $table_name, 
    [
      'id' => $id,
    ]
  );

	wp_die(); // this is required to terminate immediately and return a proper response
}
add_action( 'wp_ajax_cardboard_worldmap_delete_point', 'cardboard_worldmap_delete_point' );